define('conttrollers/mycashedCtrl',[
    'webappControllers',
    'jquery'
], function(controllers) {
    controllers.controller('mycashedCtrl', ['$scope', '$rootScope', '$filter', '$state', 'resourceService', '$localStorage', function($scope, $rootScope, $filter, $state, resourceService, $localStorage) {
        $rootScope.title = "";
        $scope.cashedId = $state.params.cashedId;
        $scope.userOBJ = $filter('isRegister')();
        $scope.toback = function() {
            $filter('')();
        };

        function DX(n) {
            var str2 = "";
            n += "";
            if (n && n.length > 0) {
                var str = n.replace(/0/g, '').replace(/1/g, '').replace(/2/g, '').replace(/3/g, '').replace(/4/g, '').replace(/5/g, '').replace(/6/g, '').replace(/7/g, '').replace(/8/g, '').replace(/9/g, '');
                str=str.split("").reverse().join("");
                for (var i = n.length-1; i >=0; i--) {
                    switch (i) {
                        case 0:
                            str2 += str.charAt(i);
                            break;
                        case 1:
                            if (str.charAt(i) != "") { str2 += str.charAt(i); }
                            str2 += "";
                            break;
                        case 2:
                            str2 += str.charAt(i)+"";
                            break;
                        case 3:
                            str2 += str.charAt(i)+"";
                            break;
                        case 4:
                            str2 += str.charAt(i)+"";
                            break;
                    }
                }
            }
            return str2;
        }
        resourceService.queryPost($scope, $filter('getUrl')(''), { id: $scope.cashedId, uid: $scope.userOBJ.user.member.uid }, { name: '' });
        $scope.$on('resourceService.QUERY_POST_MYEVENT', function(event, data, type) {
            switch (type.name) {
                case '':
                    if (data.success) {
                        $scope.cashedData = data.map
                        for (var i = 0; i < $scope.cashedData.result.length; i++) {
                            var str =DX($scope.cashedData.result[i].index) + "";
                            if ($scope.cashedData.result[i].residualPrincipal&&parseInt($scope.cashedData.result[i].residualPrincipal) <= 0) {
                                str +="+";
                            }
                            $scope.cashedData.result[i].str = str;
                        }
                    } else {
                        $filter('')(data.errorCode, $scope, 'y');
                    }
                    break;
            }
        });
    }]);
})
;
